Я, Юминов Владимир - фотограф. 
Работаю на рынке фотографии уже на протяжении 13лет,  а точнее занимаюсь этим искусством, создаю интересные динамичные свадебные снимки (фотоальбомы), которые в мельчайших деталях передают атмосферу вашего свадебного дня. В процессе съемки я не вмешиваюсь в событие и помогаю вам быть максимально настоящими и искренними!
оказываю следующие виды фотоуслуг:
- репортажная;
- свадебная;
- рекламная;
- предметная;
- уличная фотография;
- праздничных мероприятий (банкеты, юбилеи, 
  корпоративы и т.д.);
- архитектурная (недвижимость, здания, авто);
- лав-стори; 
- съемка для интернет журналов, магазинов.
- а так же снимаю на условии TFP.
- печать фотографий до А4

также кроме фото могу оказать постпечатные работы: резка, ламинирование, сканирование, ретушь, изготовление печатей и штампов, заправка лазерных картриджей, изготовление блокнотов, переплет на мет и пласт пружину
